import styled from 'styled-components';

export const Container = styled.div`
  width: 100%;
  height: 674px;
  background: #f4f4f4;
  display: flex;
  justify-content: center;
  padding: 29px 22px 57px 22px;
  h2 {
    position: absolute;
    width: 1078px;
    height: 60px;
    left: 88px;
    top: 940px;

    font-family: Poppins;
    font-style: normal;
    font-weight: 600;
    font-size: 32px;
    line-height: 48px;
    text-align: center;

    color: #000000;
  }
`;
